атным услугам","b90247069b875b973ba9a095443b2420" => "Финансовые вопросы","b5cf473b16257a496463b38d6a48edcb" => "Вопросы по работе сервиса","6a36f00ec8313ba6bcaab323322e1d29" => "Технические проблемы","2db0b7b07f06efeeb0a9658f88016c2c" => "Меня пытались обмануть","af3fc68446bf5e9b711a4106cca80fc8" => "Предложения","ff85aee93c947bdd5bd6258927d940d4" => "Другое","7fdf6df723f048a7d610d2e29ec0afdc" => "Обращение","4a7fcef25308c42229d96bf254cf08ef" => "Как к вам можно обращаться?","c0db837ecd09eefb5166c49bd8e4c156" => "Почта, на которую мы ответим","74ae10c77013a9fdccd7268e9a9d1328" => "Укажите код проверки","721864507c6eddbadc9cd17f0eda2613" => "Отправить обращение","4ff7a6e09a6146ceb40913832c41aebf" => "Вопрос в службу поддержки","7b1c170a6d767f68a49d7e9b001047a3" => "Платные услуги","3e0ee91555a22bcbee6d973fe8430172" => "Хотите продавать свои","add46e17c08c691dfc00185abf2cc7eb" => "товары быстрее?","93263c69940d0b7c224e09db677f2a91" => "Воспользуйтесь нашими дополнительными услугами! Это быстрый и удобный способ привлечь больше покупателей к вашему объявлению.","377a44812d5031c252285e82b69f8036" => "Ваше предложение увидит максимум посетителей — это увеличит шансы на быструю и выгодную продажу. Объявление будет выделено цветом, поднято в топ и размещено в специальном VIP блоке.","e9ded83e8df4f779bf9962a6a640523f" => "VIP размещение","4e76b16b5ae352f372afd95d29ce2418" => "Ваше объявление выделяется и отображается в специальном VIP блоке в каталоге товаров и в карточках объявлений.","a6de195f9b814b107f7655f5e4fa9b55" => "Поднятие в ленте","e6c29fb1a8cb15399e970bee72acf111" => "ТОП объявления показываются на самых верхних позициях и на всех страницах рубрики и региона, в которой размещено объявление. Такое расположение гарантирует, что Ваши объявления просмотрят максимально возможное количество пользователей.","db3825af7f18cc7cf700984b9ca5bd4a" => "Выберите категорию","beb17c7b102f4290331f8480b73bdfc1" => "Еще","eca2184fcd519e6e9bfa97aab8215d51" => "Название и описание",